    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 - + 46 BETWEEN - 36 AND + + col0 * - 13;
  - name: tab2

outputs:
  - name: q2314.out
    data: |
      46	51	23
      64	77	40
      75	67	58
